import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import LoginPage from "./pages/LoginPage";
import ProfilePage from "./pages/ProfilePage";
import RegisterPage from "./pages/RegisterPage";
import { useState } from "react";

function App() {
  const defaultUsers = [
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "hello@hello.lt",
      pass1: "qwerty",
      pass2: "qwerty",
    },
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "bye@bye.lt",
      pass1: "qwer",
      pass2: "qwer",
    },
  ];
  const [getUser, setUser] = useState(defaultUsers);
  const [logedinUser, setlogedinUser] = useState(null);

  return (
    <div className="App">
      <div className="d-flex">
        <BrowserRouter>
          <Header logedinUser={logedinUser} setlogedinUser={setlogedinUser} />
          <div className="grow3">
            <Routes>
              <Route
                path="/"
                element={
                  <LoginPage
                    getUser={getUser}
                    logedinUser={logedinUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />

              <Route
                path="/register"
                element={
                  <RegisterPage
                    getUser={getUser}
                    setUser={setUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />
              <Route
                path="/profile"
                element={
                  <ProfilePage
                    logedinUser={logedinUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
